function paint(number) {
    "use strict";
    var high = number.hi;
    var low = number.lo;
    //high = high & 0xAA00AA00;
    //low = low & 0xAA00AA00;
    //high = high & 0xFEAAFEAA;
    //low = low & 0xFEAAFE00;
    var index = 256;
    var art = new Uint8Array(index);
    var r = Math.random() * 128 + 128;
    var g = Math.random() * 128 + 128;
    var b = Math.random() * 128 + 128;
    var bit;
    while (index >= 128) {
        index -= 4;
        bit = low & 1;
        art[index + 0] = r * bit;
        art[index + 1] = g * bit;
        art[index + 2] = b * bit;
        art[index + 3] = 255;
        low = low >>> 1;
    }
    while (index >= 0) {
        bit = high & 1;
        art[index + 0] = r * bit;
        art[index + 1] = g * bit;
        art[index + 2] = b * bit;
        art[index + 3] = 255;
        high = high >>> 1;
        index -= 4;
    }
    return art;
}



document.addEventListener("keydown", function (item) {
    "use strict";
    draw(paint(type(item.key)));
    index_x += 0;
    index_y += 1;
});

var off = 0;

function out(high,low) {
    "use strict";
    buff(paint(int(high,low)));
    index_x += 1;
    off += 1;
    if (off%8==0) {
        off = 0;
        index_x -= 8;
        index_y += 1;
    }
    if (index_y > 254) {
        index_y = 0;
        index_x += 9;
    }
}
